import React, { Component } from 'react';
import NavBar from './Component/NavBar'
import Login from './Component/Login'
import SearchBar from './Component/SearchBar'
import './App.css';

class App extends Component {
  state = {
    Users: []
  }


  MedSearch = (e) => {
    this.setState ({
      filterComics: e.target.value

    })

   }
  render() {
    return (
      <div className="App">
        <NavBar />
        <Login />
        <SearchBar />
      </div>
    );
  }
}

export default App;
